    const handleClick = (e) => {
        e.preventDefault();
        addPokemon(pokemonName);

    }

        return( 
            <div>
                <button onClick = {handleClick}>Favorite</button>
                <p>{props.pokemonName} {props.item.id}</p>
            </div>

        )

}

export default Favorite
